    componentDidMount() {
        this.rellax = new Rellax('.rellax');
    }

    render() {
        return(
            <React.Fragment>
                <section id='projects' className='container-fluid'>
                    <div className='subtitle-box'>
                        <h3 className='subtitle is-3 has-text-centered'>PORTFOLIO</h3>
                        <Hr />
                    </div>

                    <div className='block'>
                        <div className='columns is-desktop project-columns'>
                            <Card name='Crystal Collector' button1='Demo' button2='Github'  projectLink='https://ziyadguluzade.github.io/crystal-collector/' githubLink='https://github.com/ZiyadGuluzade/crystal-collector' target='_blank' src={require('../../images/projects/amatista.jpg')} description='HTML5, CSS3, Javascript, jQuery'/>

                            <Card name='Crystal Collector' button1='Demo' button2='Github'  projectLink='https://ziyadguluzade.github.io/crystal-collector/' githubLink='https://github.com/ZiyadGuluzade/crystal-collector' target='_blank' src={require('../../images/projects/amatista.jpg')} description='HTML5, CSS3, Javascript, jQuery'/>


                            <Card name='Personal Expense Tracker' button1='Demo' button2='Github' src={require('../../images/projects/expense_tracker_app.jpg')} description='React, Javascript, Materialize.CSS, CSS3'/>    
                        </div>

                        <div className='columns is-desktop project-columns'>
                            <Card name='Google Books' button1='Demo' button2='Github'  projectLink='https://zguluzade-google-book-search.herokuapp.com/' githubLink='https://github.com/ZiyadGuluzade/google-books-app' target='_blank'  src={require('../../images/projects/google_books_app.jpg')} description='React, Javascript, Node, Express, Mongo DB, CSS3'/>

                            <Card name='Jeopardy Game' button1='Demo' button2='Github' projectLink='https://jeopardy-tribute.herokuapp.com/' githubLink='https://github.com/kmajor1/jeopardy' target='_blank' src={require('../../images/projects/jeopardy-game.jpeg')} description='React, Javascript, MongoDB, Node, Express, CSS3' />

                            <Card name='ATP Tennis Cards' button1='Demo' button2='Github' projectLink='https://jeopardy-tribute.herokuapp.com/' githubLink='https://github.com/kmajor1/jeopardy' target='_blank' src={require('../../images/projects/memory_cards_game.jpg')} description='React, Javascript, MongoDB, Node, Express, CSS3' />
                        </div>   
                    </div>

                    {/* <div className='modal-outer'>
                        <div className='modal-inner'>
                            <figure className='image is-2by1'>
                                <img src={require('../../images/projects/expense_tracker_app.jpg')} alt='project' className='project-img'></img>
                            </figure>

                            <div className='info'>
                                <h3 className='subtitle is-5 name'>Name</h3>
                                <p className='sheet'>Technical sheet:</p>
                                <a href='#' target='#'>
                                    <button type='button' className='project-button button'><span><i className="fas fa-link"></i></span><span>Demo</span></button>
                                </a>

                                <a href='#' target='#'>
                                    <button type='button' className='github-btn button'><span><i className="fab fa-github"></i></span><span>Github</span></button>
                                </a>
                            </div>
                        </div>
                    </div> */}
